import React, { useState } from 'react';
import ClipList from './components/ClipList';

function App() {
  const [activeTab, setActiveTab] = useState('editor');

  const tabs = [
    { id: 'editor', label: 'Editor', component: EditorLayout },
    { id: 'script', label: 'Script Input', component: () => <div>Script Input - Coming Soon</div> },
    { id: 'export', label: 'Export', component: () => <div>Export - Coming Soon</div> }
  ];

  const ActiveComponent = tabs.find(tab => tab.id === activeTab)?.component || EditorLayout;

  return (
    <div style={{ height: '100vh', display: 'flex', flexDirection: 'column' }}>
      {/* Tab Navigation */}
      <div style={{ 
        display: 'flex', 
        borderBottom: '1px solid #ddd', 
        background: '#f8f9fa',
        padding: '0 16px'
      }}>
        {tabs.map(tab => (
          <button
            key={tab.id}
            onClick={() => setActiveTab(tab.id)}
            style={{
              padding: '12px 24px',
              border: 'none',
              background: activeTab === tab.id ? 'white' : 'transparent',
              borderBottom: activeTab === tab.id ? '2px solid #007bff' : '2px solid transparent',
              cursor: 'pointer',
              fontWeight: activeTab === tab.id ? '600' : '400',
              color: activeTab === tab.id ? '#007bff' : '#666',
              transition: 'all 0.2s'
            }}
          >
            {tab.label}
          </button>
        ))}
      </div>

      {/* Tab Content */}
      <div style={{ flex: 1, overflow: 'hidden' }}>
        <ActiveComponent />
      </div>
    </div>
  );
}

// Editor Layout - Premiere Pro style 3-window setup
function EditorLayout() {
  return (
    <div style={{ 
      height: '100%', 
      display: 'grid', 
      gridTemplateColumns: '300px 1fr 300px',
      gridTemplateRows: '1fr 200px',
      gap: '1px',
      background: '#ddd'
    }}>
      {/* Left Panel - File Navigator */}
      <div style={{ 
        background: 'white',
        borderRight: '1px solid #ddd',
        overflow: 'hidden'
      }}>
        <div style={{ 
          height: '100%', 
          display: 'flex', 
          flexDirection: 'column',
          position: 'relative'
        }}>
          <ClipList />
        </div>
      </div>

      {/* Top Right Panel - Preview */}
      <div style={{ 
        background: 'white',
        borderRight: '1px solid #ddd',
        overflow: 'hidden'
      }}>
        <div style={{ 
          height: '100%', 
          padding: '16px',
          display: 'flex',
          flexDirection: 'column'
        }}>
          <h3 style={{ margin: '0 0 16px 0', fontSize: '16px', fontWeight: '600' }}>
            Preview
          </h3>
          <div style={{ 
            flex: 1,
            background: '#f8f9fa',
            border: '1px solid #ddd',
            borderRadius: '4px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: '#666',
            fontSize: '14px'
          }}>
            Video Preview
          </div>
        </div>
      </div>

      {/* Bottom Right Panel - Timeline */}
      <div style={{ 
        background: 'white',
        borderRight: '1px solid #ddd',
        overflow: 'hidden'
      }}>
        <div style={{ 
          height: '100%', 
          padding: '16px',
          display: 'flex',
          flexDirection: 'column'
        }}>
          <h3 style={{ margin: '0 0 16px 0', fontSize: '16px', fontWeight: '600' }}>
            Timeline
          </h3>
          <div style={{ 
            flex: 1,
            background: '#f8f9fa',
            border: '1px solid #ddd',
            borderRadius: '4px',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'center',
            color: '#666',
            fontSize: '14px'
          }}>
            Timeline Workspace
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
